    //Prop es un objeto

    return (
        <ul>
            <li><a className="active" href="#home">Home</a></li>
            <li><a href="#news">Ropa masculina</a></li>
            <li><a href="#contact">Ropa femenina</a></li>
            <li><a href="#about">Accesorios</a></li>
            <li><a href={`#${opcionAdicional}`}>{opcionAdicional}</a></li>
            <CartWidget/>
        </ul>
    )
}
